import CommonComponent from "./CommonComponent";
import WrapperComponent from "./WrapperComponent";

const PersonalDetails = WrapperComponent(CommonComponent);
const AddressDetails = WrapperComponent(CommonComponent);
const EmploymentDetails = WrapperComponent(CommonComponent);

function Hoc(props) {
  return (
    <>
      <h4>Hoc</h4>
      <div className="section">
        <fieldset className="thirty">
          <legend>Personal</legend>
          <PersonalDetails name="personal" />
        </fieldset>
        <fieldset className="thirty">
          <legend>Address</legend>
          <AddressDetails name="address" />
        </fieldset>
        <fieldset className="thirty">
          <legend>Employment</legend>
          <EmploymentDetails name="employment" />
        </fieldset>
      </div>
    </>
  );
}

export default Hoc;
